import Page from 'components/Page';
import React from 'react';
import FadeIn from 'components/FadeIn';
import 'styles/components/_data.scss';
import oneinfive from 'assets/img/logo/1in5.png';
import stigma1 from 'assets/img/logo/stigma1.png';
import stigma2 from 'assets/img/logo/stigma2.png';
import Box from '@mui/material/Box';

import {
  Row,
  CardImg,
  Col,
} from 'reactstrap';

const DataPage = () => {
  return (
    <Page title="" >
        <Row >
        <div style={{backgroundColor:"#f9c74f", width:"100%"}}>
      <FadeIn>
      <p className="dataTitle">Sobre o projeto</p>
      </FadeIn> 
      <Row>
      <Box className="dataBox">
        <CardImg src={oneinfive} style={{margin:10}}  />
      </Box>
      <div className="fact1">
      <p className="fact1content">
        1 em cada 5 portugues sofre de uma doença mental
      </p>
      </div>
      <div className="fact2">
        <p className="fact2content">
        As doenças mais graves constituem, em
grande parte, a depressão major, as perturbações bipolares e a esquizofrenia.
        </p>
      </div>
      </Row>
      <Row>
      <Box className="dataBox">
        <CardImg src={stigma2} style={{margin:10}}  />
      </Box>

      <Row>
      <div className="fact4">
      <p className="fact4title"> Estigma (Organização Mundial da Saúde) </p>
      </div>
      <p className="fact4content">"marca distintiva que, ao aliar-se às perturbações mentais, cria um ambiente de exclusão
social e discriminação perante a pessoa estigmatizada"
      </p>
      </Row>


      </Row>
     </div>
    </Row>
    </Page>
  );
};

export default DataPage;
